  return (
      <>
          <dix className={"board-row"}>
              <Square />
              <Square />
              <Square />
          </dix>
          <dix className={"board-row"}>
              <Square />
              <Square />
              <Square />
          </dix>
          <dix className={"board-row"}>
              <Square />
              <Square />
              <Square />
          </dix>
      </>
  );
}

function Square({ value }) {
    function handleClick() {
        console.log('clicked!');
    }

    return (
        <button
            className="square"
            onClick={handleClick}
        >
            {value}
        </button>
    );
}
